import React from 'react'
import s from './window.module.css'
import Header from './Header/Header';
import Content from './Content/Content';
import Icon from '../../Images/Calculator.png'

const Window = (props) => {

    return (
        <div className={s.Window} style={{ width: props.width, hieght: props.hieght }}>
            <Header SetSelectedItem={ props.SetSelectedItem } WindowName={props.WindowName} MainButtons={props.MainButtons} WindowIcon={props.WindowIcon} className={s.Header}/>
            <Content Text={props.Text} ContentComponent = { props.ContentComponent } className={s.Content}/>
        </div>
    );
}


export default Window;
